import React from "react";
import {
  AccWrapper,
  AccContainer,
  AccBar,
  AccInfoContainer,
  AccPhContainer,
  AccTxt,
  AccPh,
} from "./AccElements";

import { img } from "../../../../images/svg-9.svg";

const Account = () => {
  return (
    <>
      <AccWrapper>
        <AccContainer>
          <AccBar>
            <AccPhContainer>
              <AccPh></AccPh>
              <AccTxt></AccTxt>
            </AccPhContainer>
          </AccBar>
          <AccInfoContainer></AccInfoContainer>
        </AccContainer>
      </AccWrapper>
    </>
  );
};

export default Account;
